import React, {useEffect, useState} from 'react'
import GymCard from "./GymCard"

function Gyms() {

   const [gyms, setGyms] = useState([])

   useEffect(() => {
    fetch("http://localhost:9292/gyms")
        .then(res => res.json())
        .then(setGyms)
   }, [])

   const gymCards = gyms.map((g) => <GymCard name={g.name} address={g.address} image={g.image} rating={g.rating} />)

return 
        <div>
            {gymCards}
        </div>

}

export default Gyms
